apishi-yong-shuo-ming.html.body:
企业签章

企业已经申请签章证书完成签署,需提供企业签章编号 sealSn,可以设置多个;
企业未申请签章证书完成签署,需提供企业社会信用统一代码 creditCode,人人法会根据企业名 称生成签章完成签署,可以设置多个。

