ge-ren-qian-zi.html.body:
个人签字

手写签字,需要签署人在移动设备上进行手写签字从而完成签署,仅支持单个签字;
默认签字,签署人无需任何操作 ,人人法根据签署人姓名生成默认签字从而完成签署,可以设置多个。
